const AddEducation = () => {
    const [university2, setUniversity2] = useState('');
    const [startYear2, setStartYear2] = useState('');
    const [endYear2, setEndYear2] = useState('');
    const [degree2, setDegree2] = useState('');
return (
    <div>
        <label>University:</label>
                <input
                    type="text"
                    required
                    value={ university2 }
                    onChange={(e) => setUniversity2(e.target.value)}
                />

                <label>Start Year:</label>
                <input
                    type="number"
                    placeholder="YYYY"
                    min="1950"
                    max="2021"
                    required
                    value={ startYear2 }
                    onChange={(e) => setStartYear2(e.target.value)}
                />

                <label>End Year:</label>
                <input
                    type="text"
                    placeholder="YYYY or Present"
                    required
                    value={ endYear2 }
                    onChange={(e) => setEndYear2(e.target.value)}
                />
                <label>Degree:</label>
                <input
                    type="text"
                    required
                    value={ degree2 }
                    onChange={(e) => setDegree2(e.target.value)}
                />


    </div>
);
}

export default AddEducation;
